This is tremendous advice from one of our VeloPRO supporters.
@Regrann from @legit_commit -  Paying for a handful of lessons means absolutely nothing in your development as a player...regardless of who they are with. The HITTER needs to take ownership of his swing and put in the work (WATCH all of the video so you can see this AWESOME aggressive turn). The type of player that I've seen make huge strides in their own development do two things...#1 They don't need a coach watching them to work on their craft! YOU and only YOU will be the one that gets you to reach YOUR full potential...coaches will help along the way, but that pales in comparison with the amount of pride you take in your own development. #2 They get STRONGER. If you aren't lifting/speed training a minimum of 4 times out of season and 2 times in season, you won't see the results that you desire. Pushing yourself in the weight room will give you 10x the results you'll see compared to hitting off a tee in your basement. 
Take pride and ownership in your career. After all...ITS YOURS. (Video courtesy of @jakebohr_ ) #LegitCommit #baseball #collegebaseball #baseballislife #weightraining #develop #baseballlife #recruit #recruitment #commit #aggressive #baseballlife #prospectdugout #prospect #berecruited #uncommitted - #regrann
